import React, { useEffect, useState } from 'react'
import axios from 'axios';


function Userlist() {
    const [data, setData] = useState([])
    
    const axiosfn=()=>{
        axios.post("http://127.0.0.1:8080/findalluser")
        .then((result)=>{
            console.log(result)
            setData(result.data.data)
        })
        .catch((error)=>{
            console.log(error)
        })
        
    }
    useEffect(()=>{
        axiosfn();
    },[])
    
  return (
    <div>
        <center>    
                <h2>User List</h2><br/>
                <div>                    
                      <table border={1}>
                          <thead>
                              <tr>
                                  <th>Sl.No</th>
                                  <th>Name </th>
                                  <th>Type of Employement</th>
                                  <th>Age</th>
                                  <th>Employee ID</th>
                                  <th>Email</th>
                                  <th>Password</th>
                              </tr>
                          </thead>

                        {
                            data.length > 0 ?
                            data.map((item, index)=>(
                                <tbody key={index}>
                                    <tr>
                                        <td>{index + 1}</td>
                                        <td>{item.empname}</td>
                                        <td>{item.typeofemp}</td>
                                        <td>{item.age}</td>
                                        <td>{item.empid}</td>
                                        <td>{item.email}</td>
                                        <td>{item.password}</td>
                                    </tr>
                                </tbody>
                            )):<h3>No data found</h3>
                        }   
                      </table>

                </div>
            </center>
        </div>
  )
}

export default Userlist
